import React from "react";

export default function Collection() {
  return (
    <>
      <div className="container mt-5">
        <nav aria-label="breadcrumb" className="bg-warning py-5">
          <ol class="breadcrumb">
            <li class="breadcrumb-item active text-white" aria-current="page">
              Home
            </li>
          </ol>
        </nav>
      </div>
    </>
  );
}
